import GridIcon from "@heroicons/react/solid/ViewGridIcon";
import { Link } from "react-router-dom";
function Header() {
  const NavItems = [
    {
      title: "Login",
      link: "login",
      icon: <GridIcon />,
    },
    {
      title: "User",
      link: "user",
      //   icon: <FaUser />,
    },
  ];

  return (
    <header className="">
      <div>
        <Link to="/">Taskerr</Link>
      </div>
      <ul>
        {NavItems.map((item, idx) => (
          <Link to={item.link} key={idx}>
            {item.title} <span></span>
          </Link>
        ))}
      </ul>
    </header>
  );
}

export default Header;
